import React from 'react';
import MapComponent from './components/MapComponent';

function App() {
  return (
    <div className="App">
      <header style={{ padding: '10px', backgroundColor: '#f0f0f0', textAlign: 'center' }}>
        <h1>MapData Visualization</h1>
      </header>
      <MapComponent />
    </div>
  );
}

export default App;
